import React from 'react'
import cx from 'classnames'
import './index.scss'

const Table = ({ children, className, ...restProps }) => {
    return (
        <table className={cx('ub-table', className)} {...restProps}>
            {children}
        </table>
    )
}

const Trow = ({ children, ...restProps }) => <tr {...restProps}>{children}</tr>

const Tcol = ({ children, component, ...restProps }) => {
    if (component === 'th') {
        return <th {...restProps}>{children}</th>
    }
    return <td {...restProps}>{children}</td>
}

const Thead = ({ children, ...restProps }) => <thead {...restProps}>{children}</thead>

const Tbody = ({ children, ...restProps }) => <tbody {...restProps}>{children}</tbody>

export { Trow, Tcol, Thead, Tbody }
export default Table
